int Average565Colors(int color1, int color2)
{ // extract 565 color from 16-bit values, average them, and combine back the same way
  int red = ((color1 >> 11) + (color2 >> 11)) / 2;
  int green = (((color1 >> 5) & 0x3F) + (((color2 >> 5) & 0x3F))) / 2;
  int blue = ((color1 & 0x1F) + (color2 & 0x1F)) / 2;
  return ((red & 0x1f) << 11) | ((green & 0x3f) << 5) | (blue & 0x1F);
}

void DrawChar(byte c, int col, int row, int fg, int bg)
{
  if (postponeDrawChar)
    return;

  int mid = Average565Colors(fg, bg);  
  int offset = ((io[0x18] & 2) == 0) ? 0 : (8*256);
  const byte* shape = &chargen_rom[c*8+offset];
  int x0 = 0 + col*8;
  int y0 = 10 + row*6;
  for (int row_i=0; row_i<=5; ++row_i)
  {
    int mask = 128;
    for (int col_i=0; col_i<8; ++col_i)
    {
      if (row_i == 0) // color average the top two rows of character
        Lcd.drawPixel(x0+col_i, y0+row_i, (((shape[0] | shape[1]) & mask) == 0) ? bg : (((shape[0] & mask) == (shape[1] & mask)) ? fg : mid));
      else if (row_i == 5) // color average the bottom two rows of character
        Lcd.drawPixel(x0+col_i, y0+row_i, (((shape[6] | shape[7]) & mask) == 0) ? bg : (((shape[6] & mask) == (shape[7] & mask)) ? fg : mid));
      else // keep detail of four center rows of character
        Lcd.drawPixel(x0+col_i, y0+row_i, ((shape[row_i+1] & mask) == 0) ? bg : fg);
      mask = mask >> 1;
    }
  }
}

static void DrawChar(int offset)
{
  int col = offset % 40;
  int row = offset / 40;
  int fg = C64ColorToLCDColor(color_nybles[offset]);
  int bg = C64ColorToLCDColor(io[0x21]);
  DrawChar(ram[1024+offset], col, row, fg, bg);
}

static void RedrawScreen()
{
  int bg = C64ColorToLCDColor(io[0x21]);
  int offset = 0;
  for (int row = 0; row < 25; ++row)
  {
    for (int col = 0; col < 40; ++col)
    {
      int fg = C64ColorToLCDColor(color_nybles[offset]);
      DrawChar(ram[1024 + offset], col, row, fg, bg);
      ++offset;
    }
  }
}

static void RedrawScreenEfficientlyAfterPostponed()
{
  int bg = C64ColorToLCDColor(io[0x21]);
  int offset = 0;
  for (int row = 0; row < 25; ++row)
  {
    for (int col = 0; col < 40; ++col)
    {
      int fg = C64ColorToLCDColor(color_nybles[offset]);
      byte old_char = old_video[offset];
      byte new_char = ram[1024 + offset];
      byte old_fg_index = old_color[offset] & 0xF;
      byte new_fg_index = color_nybles[offset] & 0xF;
      if (old_char != new_char || old_fg_index != new_fg_index)
        DrawChar(new_char, col, row, fg, bg);
      ++offset;
    }
  }
}

extern byte GetMemory(ushort addr)
{
  if (addr <= sizeof(ram) - 1
      && (
        addr < basic_addr // always RAM
        || (addr >= open_addr && addr < open_addr + open_size) // always open RAM C000.CFFF
        || (((ram[1] & 3) != 3) && addr >= basic_addr && addr < basic_addr + sizeof(basic_rom)) // RAM banked instead of BASIC
        || (((ram[1] & 2) == 0) && addr >= kernal_addr && addr <= kernal_addr + sizeof(kernal_rom) - 1) // RAM banked instead of KERNAL
        || (((ram[1] & 3) == 0) && addr >= io_addr && addr < io_addr + io_size) // RAM banked instead of IO
      )
    )
    return ram[addr];
  else if (addr >= basic_addr && addr < basic_addr + sizeof(basic_rom))
    return basic_rom[addr - basic_addr];
  else if (addr >= io_addr && addr < io_addr + io_size)
  {
    if ((ram[1] & 4) == 0)
      return chargen_rom[addr - io_addr];
    else if (addr >= color_addr && addr < color_addr + sizeof(color_nybles))
      return color_nybles[addr - color_addr] | 0xF0;
    else if (addr == 0xDC01)
    {
      ReadKeyboard();

      int value = 0;
      
      for (int i=0; i<16; ++i)
      {
        int scan_code = scan_codes[i] & 127; // remove any modifiers
        if (scan_code < 64)
        {     
          int col = scan_code / 8;
          int row = scan_code % 8;
          
          if ((io[0xC00] & (1 << col)) == 0)
            value |= (1 << row);
        }
      }
      
      return ~value;
    }
    else
      return io[addr - io_addr];
  }
  else if (addr >= kernal_addr && addr <= kernal_addr + sizeof(kernal_rom)-1)
    return kernal_rom[addr - kernal_addr];
  else
    return 0xFF;
}

extern void SetMemory(ushort addr, byte value)
{
  if (addr <= sizeof(ram) - 1
    && (
      addr < io_addr // RAM, including open RAM, and RAM under BASIC
      || (addr >= kernal_addr && addr <= kernal_addr + sizeof(kernal_rom) - 1) // RAM under KERNAL
      || (((ram[1] & 7) == 0) && addr >= io_addr && addr < io_addr + io_size) // RAM banked in instead of IO
      )
    )
  {
    bool changedRequiresUpdate = ram[addr] != value;
    if (changedRequiresUpdate)
    {
      ram[addr] = value;
      if (addr >= 1024 && addr < 2024)
        DrawChar(addr-1024);
    }
  }
  else if (addr == 0xD018) // VIC-II Chip Memory Control Register
  {
    io[addr - io_addr] = value;
    RedrawScreen(); // upper to lower or lower to upper
  }
  else if (addr == 0xD020) // border
  {
    int border = C64ColorToLCDColor(value);
    Lcd.fillRect(0, 0, 320, 10, border);
    Lcd.fillRect(0, 160, 320, 10, border);
    io[addr - io_addr] = value & 0xF;
  } 
  else if (addr == 0xD021) // background
  {
    io[addr - io_addr] = value & 0xF;
    RedrawScreen();
  }
  else if (addr >= color_addr && addr < color_addr + sizeof(color_nybles))
  {
    int offset = addr - color_addr;
    bool colorChange = (color_nybles[offset] != value);
    if (colorChange)
    {
      color_nybles[offset] = value;
      char charAtOffset = ram[1024 + offset];
      bool isBlank = (charAtOffset == ' ' || charAtOffset == 96);
      bool requiresRedraw = !isBlank;
      if (requiresRedraw)
        DrawChar(offset);
    }
  }
  else if (addr == 0xDC00)
  {
    io[addr - io_addr] = value;
  } 
}

